import styled from 'styled-components';

export default function Layout({ children }) {
  <Wrapper>
    <header>COVID-19 Stats</header>
    <div>{children}</div>
    <footer>Tester</footer>
  </Wrapper>;
}

const Wrapper = styled.div`
  header {
    background: white;
  }
`;
